import React from 'react';
import { motion } from 'framer-motion';
import { ChevronDown, Github, Linkedin, Mail, Download } from 'lucide-react';
import { useInView } from 'react-intersection-observer';

const Hero = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });
  const resumeUrl = process.env.PUBLIC_URL + '/Resume.pdf';

  const socialLinks = [
    { icon: Github, href: 'https://github.com/TheOnlyBaddy', label: 'GitHub' },
    { icon: Linkedin, href: 'https://www.linkedin.com/in/shubh-barnwal', label: 'LinkedIn' },
    { icon: Mail, href: 'mailto:barnwalshubh8002434@gmail.com', label: 'Email' },
  ];

  const scrollToNext = () => {
    const aboutSection = document.querySelector('#about');
    if (aboutSection) {
      aboutSection.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <section id="home" className="min-h-screen flex items-center justify-center relative overflow-hidden">
      {/* Background Blur Effect */}
      <div className="absolute inset-0 bg-gradient-to-br from-blue-50/30 via-transparent to-purple-50/30 dark:from-blue-900/10 dark:via-transparent dark:to-purple-900/10 backdrop-blur-[1px]"></div>

      {/* Floating Background Elements */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        <div className="absolute top-20 left-20 w-72 h-72 bg-gradient-to-r from-blue-400/20 to-purple-400/20 rounded-full blur-3xl animate-pulse"></div>
        <div className="absolute bottom-20 right-20 w-96 h-96 bg-gradient-to-r from-purple-400/20 to-pink-400/20 rounded-full blur-3xl animate-pulse" style={{animationDelay: '2s'}}></div>
      </div>

      <div className="container-custom relative z-10">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center"
        >
          {/* Greeting */}
          <motion.p
            className="text-lg text-primary-600 dark:text-primary-400 mb-2"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            Hello, I'm
          </motion.p>

          <motion.h1
            className="text-5xl md:text-7xl font-bold text-dark-900 dark:text-white mb-4"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <span className="gradient-text">Shubh Barnwal</span>
          </motion.h1>

          <motion.h2
            className="text-2xl md:text-3xl font-semibold text-dark-700 dark:text-dark-300 mb-8"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.6 }}
          >
            Full Stack Developer
          </motion.h2>

          {/* Description */}
          <motion.p
            className="text-lg text-dark-600 dark:text-dark-400 max-w-3xl mx-auto mb-8"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.8 }}
          >
            I craft digital experiences with clean code and innovative solutions. 
            Passionate about building scalable applications and turning ideas into reality.
          </motion.p>

          {/* Technology Badges */}
          <motion.div 
            className="flex flex-wrap justify-center gap-3 mb-8 max-w-3xl mx-auto"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 1.0 }}
          >
            {['JavaScript', 'React', 'Node.js', 'Python', 'MongoDB', 'SQL', 'Tailwind', 'Git'].map((tech, index) => (
              <motion.span
                key={tech}
                className="px-3 py-1.5 text-sm font-medium rounded-full bg-white dark:bg-dark-700 text-dark-700 dark:text-dark-200 shadow-sm border border-gray-200 dark:border-dark-600 hover:shadow-md transition-all duration-300"
                whileHover={{ y: -3, scale: 1.05 }}
                initial={{ opacity: 0, y: 10 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ 
                  duration: 0.4, 
                  delay: 1.1 + (index * 0.05),
                  type: 'spring',
                  stiffness: 100
                }}
              >
                {tech}
              </motion.span>
            ))}
          </motion.div>

          {/* CTA Buttons */}
          <motion.div
            className="flex flex-wrap justify-center gap-4"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 1.0 }}
          >
            <motion.div 
              className="relative group"
              whileHover={{ y: -2 }}
              whileTap={{ scale: 0.98 }}
            >
              <div className="absolute -inset-1 bg-gradient-to-r from-primary-500 to-cyan-500 rounded-full blur opacity-20 group-hover:opacity-30 transition-all duration-300"></div>
              <motion.a
                href={resumeUrl}
                download
                className="relative px-8 py-3.5 bg-gradient-to-r from-primary-600 to-cyan-600 text-white font-semibold rounded-full shadow-lg hover:shadow-xl transition-all duration-300 flex items-center justify-center gap-2 group-hover:from-primary-500 group-hover:to-cyan-500"
              >
                <motion.span 
                  className="inline-block group-hover:translate-y-[-2px] transition-transform duration-300"
                  initial={false}
                >
                  <Download className="h-5 w-5" />
                </motion.span>
                <span>Download CV</span>
              </motion.a>
            </motion.div>

            <motion.div 
              className="relative group"
              whileHover={{ y: -2 }}
              whileTap={{ scale: 0.98 }}
            >
              <div className="absolute -inset-1 bg-gradient-to-r from-dark-100 to-dark-200 dark:from-dark-700 dark:to-dark-600 rounded-full blur opacity-0 group-hover:opacity-100 transition-all duration-300"></div>
              <motion.button
                onClick={scrollToNext}
                className="relative px-6 py-3 bg-white dark:bg-dark-800 text-dark-900 dark:text-white font-medium rounded-full shadow-sm hover:shadow-md transition-all duration-300 flex items-center justify-center gap-2 text-sm sm:text-base"
              >
                <span>View My Work</span>
                <ChevronDown className="h-4 w-4 sm:h-5 sm:w-5 group-hover:translate-y-0.5 transition-transform" />
              </motion.button>
            </motion.div>
          </motion.div>

          {/* Social Links */}
          <motion.div
            className="flex items-center justify-center gap-4 mt-8"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.6, delay: 1.2 }}
          >
            {socialLinks.map((link, index) => (
              <motion.a
                key={link.label}
                href={link.href}
                target="_blank"
                rel="noopener noreferrer"
                className="p-2 text-dark-500 dark:text-dark-400 hover:text-primary-600 dark:hover:text-primary-400 transition-colors duration-300"
                whileHover={{ y: -3, scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
                initial={{ opacity: 0, y: 20 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.4, delay: 1.4 + index * 0.1 }}
                aria-label={link.label}
              >
                <link.icon className="h-5 w-5 sm:h-6 sm:w-6" />
              </motion.a>
            ))}
          </motion.div>
        </motion.div>
      </div>

      {/* Scroll Down Indicator */}
      <motion.div
        className="absolute bottom-8 left-1/2 transform -translate-x-1/2 cursor-pointer"
        onClick={scrollToNext}
        initial={{ opacity: 0, y: 20 }}
        animate={inView ? { opacity: 1, y: 0 } : {}}
        transition={{ duration: 0.6, delay: 1.8, repeat: Infinity, repeatType: 'reverse', repeatDelay: 0.5 }}
      >
        <ChevronDown className="h-7 w-7 text-dark-400 dark:text-dark-500" />
      </motion.div>

      {/* Floating Code Elements */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        <motion.div
          className="absolute top-1/4 left-10 text-xs text-primary-400/30 dark:text-primary-300/30 font-mono"
          animate={{ 
            y: [0, -20, 0],
            opacity: [0.3, 0.6, 0.3]
          }}
          transition={{ duration: 8, repeat: Infinity }}
        >
